import React from "react";
import firebas from "firebase";

export default class App extends React.Component {
	constructor(props){
		super(props);
	};
	conponentDidMount(){
		firebase.initializeApp(firebaseConfig);
	};
	render(){
		const { Component, pageProps } = this.props;
		return <Component {...pageProps}/>
	};
};
